  return (
    <div>
      <p>sdgfhasdasdasdasdtrdasfg</p>
      <p>dsfasdasdasdghtrads</p>
      {/* {console.log(props.statistics)} */}
      <VideoDisplay statistics={props.statistics} />
    </div>
  );
}
